import { createSelector } from "reselect";

const selectShop = (state) => state.shop;

const Collection_ID_MAP = {
  hats: 1,
  sneakers: 2,
  jackets: 3,
  women: 4,
  men: 5,
};

export const selectorCollections = createSelector(
  [selectShop],
  (shop) => shop
);
